def velocity(pos):
    vel = []
    for i in range(0, len(pos)-1):
        tmp = (pos[i+1]-pos[i])/dt
        vel.append(tmp)
    vel.append(0)
    return vel  

def shorten(arr, low, high, t):
    tmp = []
    for i in range(0, len(arr)):
        if t[i] > low and t[i] < high:
            tmp.append(arr[i])
    return tmp

